import * as React from 'react';
import { StyleSheet } from 'react-native';
import { TextInput, Button } from 'react-native-paper';

import { Text, View } from '../components/Themed';

export default function Login({navigation}) {
  const [userName, setUsername] = React.useState('');
  const [inProgress, setInProgress] = React.useState(false);

  const onChangeUsernameText = (inputName: string) => {
    setUsername(inputName);
  }

  const onChangePasswordText = (inputPassword: string) => {
    setUsername(inputName);
  }

  const onPressDoLogin = () => {
    setInProgress(true);
    console.log('Send query...')
  }
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Get Onboard</Text>
      <TextInput
        label="Email"
        value={userName}
        onChangeText={onChangeUsernameText}
        style={styles.input}
      />
      <TextInput
        secureTextEntry={true}
        label="Password"
        value={''}
        onChangeText={() => console.log('typing password...')}
        style={styles.input}
      />
      <Button
        mode="contained"
        loading={inProgress}
        onPress={onPressDoLogin}
        accessibilityLabel="LogIn"
      >
        Log in
      </Button>
      <Button
        compact
        onPress={() => navigation.navigate('Register')}
        accessibilityLabel="Register"
      >
        Register
      </Button>
    </View>

  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  input: {
    marginTop: 10,
    marginBottom: 10,
    width: '80%',
  },
});
